  \"2016-10-08T15:56:11.082134\",\n\t\"name\": \"assessment-of-nest-fates-of-woodland-songbirds-in-j-clark-slayer-national-wildlife-refuge-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Progress report for the 2002 field season
  of a study to assess nest fates of woodland songbirds in J. Clark Slayer National
  Wildlife Refuge (JCSNWR), in northcentral North Dakota.  Since 1997, refuge staff
  have been assessing the effects of habitat management on the occurrence and productivity
  of grassland bird species.  The goals of this study is to provide basin information
  on all nesting birds in the aspen dominated woodlands of JCSNWR.  The primary objectives
  of this study are to (l) determine what bird species are nesting in aspen-dominated
  woodlands on JCSNWR, (2) estimate rates of nest success, nest predation, and cowbird
  parasitism for songbirds nesting in these woodlands, and (3) compare these rates
  to those estimated for grassland songbirds nesting within the parkland landscape
  (i.e., near woodland) and within a grass/crop-dominated landscape (i.e., far from
  woodland) on JCSNWR.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
